    }

    render(){
        return (
            <div>
            <br />
            <h2>New Scan</h2>
            
            <CustomForm 
                requestType="post" 
                jobpostID={null} 
                btnText="Create"
                {...this.props}/>


            <CustomForm 
                requestType="post" 
                jobpostID={null} 
                btnText="Create"
                {...this.props}/>
            </div>
        )
    }
}

export default Comparison;
